function [] = case_3_twomethods( v1 , v2, v3 )

%分解奇异向量
v11 = v1(1:3,:);    
v12 = v1(4:6,:);
v13 = v1(7:9,:);    %将奇异向量每三行分开，每个部分分别对应r1,r2,r3

v21 = v2(1:3,:);
v22 = v2(4:6,:);
v23 = v2(7:9,:);

v31 = v3(1:3,:);
v32 = v3(4:6,:);
v33 = v3(7:9,:);

%设置系数未知数
syms a1 a2 a3 real; 
syms k1 k2 real;

%构建三个r的等式，并利用约束，顺便消去a1
r1 = (v11 + k1.*v21 + k2.*v31);
r2 = (v12 + k1.*v22 + k2.*v32);
r3 = (v13 + k1.*v23 + k2.*v33);

%矩阵B元素
g1 = dot(r1,r1) - dot(r2,r2);
g2 = dot(r1,r1) - dot(r3,r3);
f4 = dot(r1,r2);
f5 = dot(r1,r3);
f6 = dot(r2,r3);
% B = [g1;g2;f4;f5;f6];

%求代价函数C_k1k2
C_k1k2 = (g1)^2 + (g2)^2 + (f4)^2 + (f5)^2 + (f6)^2;



%分别对k1，k2求偏导
t1 = diff(C_k1k2,k1);
t2 = diff(C_k1k2,k2);


%使用coeffs函数提取系数，这里按照论文的方法将k2看作常数
c1 = coeffs(t1,k1);
c2 = coeffs(t2,k1);

c11 = c1(1,4);
c12 = c1(1,3);
c13 = c1(1,2);
c14 = c1(1,1);

c21 = c2(1,4);
c22 = c2(1,3);
c23 = c2(1,2);
c24 = c2(1,1);

%构造文中（22）矩阵
