        c12 c11   0 c22 c21   0;
        c13 c12 c11 c23 c22 c21;
        c14 c13 c12 c24 c23 c22;
          0 c14 c13   0 c24 c23
          0   0 c14   0   0 c24];
      
%求上面矩阵的行列式，得到函数f_k
f_k = det(mat1);
